Une version provisoire du compact (draft 2) a été élaborée grâce à une approche inclusive, reposant sur une équipe nationale, avec l’appui d’une consultante internationale recrutée par l’OMS et d’autres partenaires. Le processus d’élaboration a suivi les principales étapes suivantes :
- organisation de plusieurs séances d’information incluant les différentes parties prenantes ;
- organisation d’ateliers sous forme de travaux de groupe en février 2012 qui a abouti à un pré-consensus sur les piliers du Compact;
- élaboration d’un projet de document de Compact (draft 1) ;
- amendement du draft 1 en atelier en mars 2012 ;
-  transmission du draft 2,  le 22 mars 2012 aux futurs signataires pour observations ;
- présentation au Conseil d’administration du secteur ministériel (CASEM) de la santé du draft2 le 30 mars 2012.
Les prochaines étapes de finalisation du document de compact :
- recueil  des amendements et examen par l’équipe technique nationale ;
- tenue d’un déjeuner de travail/ atelier d’ici mai ;
- échanges en vue d’atteindre un consensus ;
- finalisation, signature d’ici fin juin en harmonie avec la table ronde des bailleurs de fonds  et mise en œuvre.
En rappel, le Burkina Faso a signé le compact international en mai 2010, lors de l'Assemblée mondiale de la santé.











