{"value": "Le Burkina Faso a adopté en août 2011, la nouvelle Politique nationale de santé (PNS) et le Plan national de développement sanitaire (PNDS 2011-2020). Le nouveau PNDS 2011-2020 comprend 8 orientaions stratégiques que sont:
- le développement du leadership et de la gouvernance dans le secteur de la santé ;
- l’amélioration des prestations de services de santé ;
- la promotion de la santé et lutte contre la maladie ;
- le développement des ressources humaines pour la santé ;
- le développement des infrastructures, des équipements et des produits de santé ;
- l’amélioration de la gestion du système d’information  sanitaire ;
- la promotion de la recherche pour la santé ;  
- l’accroissement du financement de la santé et amélioration de l’accessibilité financière des populations aux services de santé. 
Ces deux documents sont disponibles sur le site web du Ministère de la santé (www.sante.gov.bf). Le PNDS sera mis en oeuvre par des plans triennaux glissants (2011-2013; 2012-2014; 2013-2015; ... 2018-2020). 
le plan triennal 2011-2013 a été élaboré, budgetisé et sa mise en œuvre est en cours. Le coût total du PNDS 2011-2020 a été évalué à 5 705,72 milliards de FCFA. Ce coût a été reparti par orientation stratégique. Par ailleurs, le Ministère de la santé poursuit l'élaboration d'un CDMT triennal glissant. Cette année 2012, un budget programme sera également élaboré au cours du second semestre et remplacera à terme le CDMT. Il couvrira la periode 2013-2015 du fait de son caractère triennal glissant."}

{"value": "On peut noter qu'il y a un mécanisme d'évaluation dans le cadre du Plan National de Développement Sanitaire. Ce plan comporte des indicateurs pour lesquels les différents partenaires dont l'OMS participent à la mesure et l'analyse.

Par ailleurs les recommandations suivantes ont été faites:

Mettre en place un suivi-évaluation comprenant notamment :
- un cadre de résultats bâti sur les indicateurs du PNDS dont le nombre devra être fortement réduit (à une trentaine ?). Ce tableau de bord sectoriel devra faire l’objet d’un accord quant aux indicateurs concernés, leur mesure et les sources de données ;
- une revue annuelle conjointe du PNDS et du CDMT (gouvernement et partenaires). 
"}

