{"value": "The “terms of reference of Health partners Coordination Framework” highlights three  levels of health sector coordination mechanism:
 i. Sectoral Coordination Committee (CCS) MISAU and partners interface at the highest levels to consider strategic issues, centred around the Annual Joint Review meetings and the endorsement of the annual health sector Economic and Social Plans (PES), bi-annual meetings chaired by the minister;
 ii. Joint Coordinating Committee (CCC) MISAU and partners interact on a monthly basis to deal with planning and operational issues, centred on monthly CCC meetings, chaired by the permanent secretary. At least twice per year there will be an enlarged CCC-meeting, where all health partners will be able to participate in; 
iii. Joint Working Groups (WG) MISAU and partners also interact at a technical and operational level centred on formal and ad hoc Working Group interaction, chaired by MISAU staff and co-chaired by partners. Some examples are WG of M&E, of HRH, HIV/AIDS, of malaria, of TB, etc. 

"}

