{"value": "(14,810 is for figure for 2010 public only)
Il s'agit  dans ce cas précis du personnel exerçant effectivement dans les formations sanitaires publiques (Cf. annuaire statistique 2010 disponible sur le site www.insd.bf)
Le ratio nombre d'habitants/Personnel médical est en amélioration (1372 en 2007 contre 1204 en 2009 et 1062 en 2010). Cependant, les ressources humaines en santé sont  caractérisées par :
- une insuffisance de personnel (les ratios du personnel exerçant dans les formations sanitaires publiques sont inférieurs aux normes de l'OMS);
-une concentration du personnel dans les zones urbaines au détriment des zones rurales;
-une insuffisance de sage femmes;
- une insuffisance de médecins.             Les 14,180 représentent le personnel exerçant dans le secteur public comme mentionné dans l’outil que je vous ai transmis. La collecte actuelle des données au niveau de la Direction générale de l’information et des statistiques sanitaires du Burkina Faso ne collecte pas les données relatives au personnel évoluant dans le secteur privé. Cependant, j’ai été consultant dans une étude qui nous a permis de collecte au niveau des ordres professionnels certaines informations que sont :
- L’ordre national des médecins dénombre 1740 médecins toute spécialité confondue inscrit au niveau de son tableau. L’annuaire statistique dénombre 518 médecins exerçant dans le public.
- L’ordre national des pharmaciens du Burkina dénombrait 520 pharmaciens toute spécialité confondue inscrit au niveau de son tableau. L’annuaire statistique dénombre 184 pharmaciens exerçant dans le public.
Des ajustements des outils et du dispositif de collecte des données sont en cours au niveau de la Direction générale de l’information et des statistiques sanitaires du Burkina Faso pour permettre une collecte des données relatives au personnel exerçant dans le public comme dans le privé.
"}

{"value": "La deuxième revue conjointe du secteur de la santé s'est tenue à Ouagadougou les 3 et 4 mars 2011 . Elle a été présidée par inistre de l'économie et des finance et a connu la participation de représentants des institutions  (Assemblée nationale, Conseil économique et social) et de départements ministériels, des partenaires techniques et financiers, des gouverneurs de régions ainsi que des représentants des conseils régionaux, de l’association des municipalités du Burkina, du sous secteur sanitaire privé, des organismes de coopération bilatérale et multilatérale, des ordres professionnels de la santé, des Organisations de la société civile et des Organisations non gouvernementales (ONG). 


Au cours des assises, trois thématiques ont fait l'objet d'échanges fructueux. Il s'agit de l'analyse de la santé communautaire, de l'évaluation des besoins en soins obstétricaux et néonatales d'urgence (SONU) et de la revue approfondie du programme élargi de vaccination. Au cours des échanges les partenaires ont salué l’invitation l'invitation qui leur a été adressée, une démarche hautement appréciable dans le domaine du partenariat tant elle dénote de la transparence et consolide la confiance mutuelle. Cette rencontre, qui avait pour objectif de renforcer le cadre de dialogue, a permis de faire le bilan des activités de l'année 2010, a traduit une fois une de plus la volonté du gouvernement d'impliquer tous les acteurs de la santé dans l'évaluation des actions en faveur de la santé. Des recommandations ont été formulées à l'issue des deux jours de travaux. 








"}

